def get_level(term: Term) -> Optional[int]:
    if term in N5:
        return 5
    if term in N4:
        return 4
    if term in N3:
        return 3
    if term in N2:
        return 2
    if term in N1:
        return 1
    if term in COMMON:
        return 0
    return None

def tag_level(definition: Definition) -> Optional[str]:
    level = get_level(definition.term)
    if level is None:
        return None
    elif level > 0:
        return f"N{level}"
    else:
        return "通常使用"


class TestJlpt(unittest.TestCase):
    def test_get_level(self):
        self.assertEqual(5, get_level(Term("学校", "がっこう")))
        self.assertEqual(4, get_level(Term("文化", "ぶんか")))
        self.assertEqual(3, get_level(Term("舞台", "ぶたい")))
        self.assertEqual(2, get_level(Term("儀式", "ぎしき")))
        self.assertEqual(1, get_level(Term("農場", "のうじょう")))
        self.assertEqual(0, get_level(Term("北海道", "ほっかいどう")))
        self.assertEqual(None, get_level(Term("瘧", "おこり")))
